import axios from "axios";

type Todo = {
    userId : number,
    id : number,
    title : string,
    completed : boolean
}

const fetchTodos = async () => {
    const result = await axios.get<Todo[]>("https://jsonplaceholder.typicode.com/todos");
    return result.data;
}

